@param bytecode 目标合约的完整字节码（包含构造函数参数）
@param _salt 部署时使用的盐值
@return 预测的合约地址

地址计算公式遵循EIP-1014标准：
address = 最低160位(keccak256(0xff ++ 工厂地址 ++ salt ++ keccak256(bytecode)))

